function useInView(ref) {
  const [inView, setInView] = useState(false);
  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => { if (entry.isIntersecting) setInView(true); },
      { threshold: 0.1 }
    );
    if (ref.current) observer.observe(ref.current);
    return () => observer.disconnect();
  }, []);
  return inView;
}

function AnimatedSection({ children, delay = 0, dir = "up" }) {
  const ref = useRef();
  const inView = useInView(ref);
  const transforms = {
    up: inView ? "translateY(0) scale(1)" : "translateY(60px) scale(0.97)",
    left: inView ? "translateX(0) scale(1)" : "translateX(-60px) scale(0.97)",
    right: inView ? "translateX(0) scale(1)" : "translateX(60px) scale(0.97)",
  };
  return (
    <div ref={ref} style={{
      opacity: inView ? 1 : 0,
      transform: transforms[dir] || transforms.up,
      filter: inView ? "blur(0px)" : "blur(4px)",
      transition: `all 1s cubic-bezier(0.16,1,0.3,1) ${delay}ms`,
    }}>
      {children}
    </div>
  );
}

function GlowCard({ children, color = "#e8c547", style = {} }) {
  const [hov, setHov] = useState(false);
  return (
    <div
      onMouseEnter={() => setHov(true)}
      onMouseLeave={() => setHov(false)}
      style={{
        position: "relative", transition: "all 0.4s ease",
        boxShadow: hov ? `0 20px 60px ${color}20, 0 0 0 1px ${color}30` : "none",
        transform: hov ? "translateY(-4px)" : "translateY(0)",
        ...style,
      }}
    >
      {hov && <div style={{
        position: "absolute", inset: 0, pointerEvents: "none",
        background: `radial-gradient(circle at 50% 0%, ${color}12, transparent 70%)`,
        borderRadius: "inherit",
      }} />}
      {children}
    </div>
  );
}

function Particle({ color, delay, x, y }) {
  return (
    <div style={{
      position: "absolute", left: x, top: y,
      width: "4px", height: "4px",
      background: color, borderRadius: "50%",
      animation: `particleDrift ${3 + Math.random() * 2}s ease-in-out infinite`,
      animationDelay: `${delay}s`,
      pointerEvents: "none",
    }} />
  );
}

function SkillBar({ skill, index }) {
  const ref = useRef();
  const inView = useInView(ref);
  const widths = [88,82,78,85,90,80,75,92,87,83,79,95,88,82];
  const w = widths[index % widths.length];
  return (
    <div ref={ref} style={{ marginBottom: "14px" }}>
      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "5px" }}>
        <span style={{ fontSize: "13px", color: "rgba(240,236,224,0.75)" }}>{skill}</span>
        <span style={{ fontSize: "11px", color: "#e8c547" }}>{w}%</span>
      </div>
      <div style={{ height: "2px", background: "rgba(255,255,255,0.07)", borderRadius: "1px" }}>
        <div style={{
          height: "100%", background: "linear-gradient(90deg,#e8c547,#ff6b35)",
          borderRadius: "1px", width: inView ? `${w}%` : "0%",
          transition: `width 1.3s cubic-bezier(0.16,1,0.3,1) ${index * 80}ms`,
          boxShadow: "0 0 10px rgba(232,197,71,0.5)",
        }} />
      </div>
    </div>
  );
}

